import React, { useState } from 'react';


const CreateChar = () => {
  const [STR, setSTR] = useState('')
  const [DEX, setDEX] = useState('')
  const [CON, setCON] = useState('')
  const [INT, setINT] = useState('')
  const [WIS, setWIS] = useState('')
  const [CHA, setCHA] = useState('')
  const table = {
    3: "-4",
    4: "-3",
    5: "-3",
    6: "-2",
    7: "-2",
    8: "-1",
    9: "-1",  
    10:"+0",
    11:"+0",
    12:"+1",
    13:"+1",
    14:"+2",
    15:"+2",
    16:"+3",
    17:"+3",
    18:"+4",
  }
  
  function getRandomInt () {
    let min = Math.ceil(3);
    let max = Math.floor(18);
    return Math.floor(Math.random() * (max - min) + min); 
  }  
  
  const rollStat = (e) =>{
    let value = getRandomInt()
    return value
  }
  
  const rollStats = (e) =>{
    e.preventDefault()
    setSTR(rollStat())
    setDEX(rollStat())
    setCON(rollStat())
    setINT(rollStat())
    setWIS(rollStat())
    setCHA(rollStat())
  }
  
  return ( 
    <>
      <div className='app'>
        <form onSubmit={rollStats}>

          <button type="submit">Roll Stats</button>
        </form>
      </div>
      <h2>Your Character Deets</h2>
      <h3>Class : 
        <select name="class" id="class">
          <option value="Barbarian">Barbarian</option>
          <option value="Bard">Bard</option>
          <option value="Cleric">Cleric</option>
          <option value="Druid">Druid</option>
          <option value="Fighter">Fighter</option>
          <option value="Monk">Monk</option>
          <option value="Paladin">Paladin</option>
          <option value="Ranger">Ranger</option>
          <option value="Rogue">Rogue</option>
          <option value="Sorcerer">Sorcerer</option>
          <option value="Warlock">Warlock</option>
          <option value="Wizard">Wizard</option>
        </select>
      </h3>
      <h3>Race : 
        <select name="Race" id="Race">
            <option value="dragonborn">Dragonborn</option>
            <option value="dwarf">Drawf</option>
            <option value="elf">Elf</option>
            <option value="gnome">Gnome</option>
            <option value="half-elf">Half-Elf</option>
            <option value="half-orc">Half-Orc</option>
            <option value="halfling">Halfling</option>
            <option value="human">Human</option>
            <option value="tiefling">Tiefling</option>
          </select>
        </h3>
      <h4>STR: {STR} ({table[STR]}) </h4>
      <h4>DEX: {DEX} ({table[DEX]})</h4>
      <h4>CON: {CON} ({table[CON]})</h4>
      <h4>INT: {INT} ({table[INT]})</h4>
      <h4>WIS: {WIS} ({table[WIS]})</h4>
      <h4>CHA: {CHA} ({table[CHA]})</h4>
      
    </>
  );
}
export default CreateChar;


